message: "국민체육진흥공단이 발행하는 체육진흥투표권 스포츠토토의 수탁사업자 스포츠토토코리아가 7일 '전국 50개 지역을 타겟으로 총 170개소의 신규판매인을 모집한다'고 밝혀졌다. 요번 신규판매인 모집 공고는 7일(월)부터 19일(금)까지 약 2주간 이뤄지며, 신청 접수는 22일(월) 5시부터 30일(금) 오후 10시까지 스포츠토토 홈페이지 내 '신규판매인 신청응시'를 통해 신청이 가능하다. \r\n \r\n[url=https://www.dajaba01.com/]다자바[/url]"
